import React from 'react';
import './index.css';
import { createUseStyles } from 'react-jss';

const useStyles = createUseStyles({
    bar: {
        height: '60px',
        backgroundColor: 'black',
        boxShadow: '0 10px 15px rgba(0, 0, 0, 0.2)',
        display: 'flex',
    },
    title: {
        fontSize: '32px',
        fontWeight: '500',
        color: 'white',
        marginTop: '12px',
        marginLeft: '10%',
    },
    menuButton: {
        height: '28px',
        width: '50px',
        fontSize: '14px',
        color: '#171717',
        background: 'gray',
        borderRadius: '5px',
        marginTop: '14px',
        marginLeft: '80px',
        textAlign: 'center',
    }
});

export const NavBar = () => {
    const styles = useStyles();

    return (
        <div className={styles.bar}>
            <div className={styles.title}>
                Hello There!
        </div>
            <div className={styles.menuButton} onClick={() => alert("General Kenobi")}>
                <div style={{ marginTop: '6px' }}>Button</div>
            </div>
        </div>
    );
};

export default NavBar;
